lin_info = {'TEM': '℃',
            'PRS_HWC': 'hPa',
            'rh': '%',
            'WIN_D': '°',
            'WIN_S': 'm/s', }

re_name = {'tem': 'TEM', 'pre': 'PRS_HWC', 'wd': 'WIN_D', 'ws': 'WIN_S', 'td': 'DTP',
           'hz': 'GPH', 'tlnp': 'tlnp'}

class Lliners:
    def __init__(self, input_filelist, ele, title):
        self.file_names = file_exit(input_filelist[0].get('filePath'))
        self.ele = re_name[ele]
        self.title = title
        with open(self.file_names, mode='rb') as f:
            content_list = [i.strip() for i in f]
        jsons = content_list[0].decode()
        self.df = DataFrame(json.loads(jsons), dtype=float)
        self.df[self.df >= 999998] = None
        self.data = self.df.sort_values(by='PRS_HWC', ascending=False)
        self.data_time = datetime.datetime(int(self.data.Year_Data[0]), int(self.data.Mon_Data[0]), int(self.data.Day_Data[0]),
                                           int(self.data.Hour_Data[0])) + datetime.timedelta(hours=8)
        self.pic_path = config_info.get_ltk_cfg['pic_path']

    def UTC_BJT(self, info):
        """
        :param info: 输入时间
        :return: 世界时转化为北京时
        """
        dt = datetime.datetime.strptime(info, "%Y%m%d%H%M%S")
        strdt = dt + datetime.timedelta(hours=8)
        return datetime.datetime.strftime(strdt, "%Y%m%d%H%M%S")

    def get_pro_data(self):
        time_mis = []
        tem = []
        pre = []
        rh = []
        wd = []
        ws = []
        h = []
        lon_de = []
        lat_de = []
        with open(self.file_names, mode='rb') as f:
            content_list = [i.strip() for i in f]

            x = content_list[1].split(b' ')
            SURF_CHN_BASIC_INFO_ID = x[0].decode()  # 区站号
            LON = x[1].decode()  # 经度
            LAT = x[2].decode()  # 纬度
            t = content_list[4].split(b' ')
            D_DATETIME = self.UTC_BJT(t[0].decode())  # 观测时间
            is_continued = False
            for txt in content_list[5:-1]:

                if "MINUTE" in txt.decode():
                    is_continued = True
                    continue
                if is_continued:
                    obj = {}
                    # 将文件中的‘/’, 转换成对应的‘9’
                    info = txt.decode().replace("/", '9').split()
                    time_mis.append(float(info[0]))  # 时间差
                    tem.append(float(info[1]))  # 温度
                    pre.append(float(info[2]))  # 压强
                    rh.append(float(info[3]))  # 相对湿度
                    wd.append(float(info[4]))  # 风向
                    ws.append(float(info[5]))  # 风速
                    h.append(np.around(float(info[6]) / 1000, 2))  # 位势高度
                    lon_de.append(float(info[7]))  # 经度偏差
                    lat_de.append(float(info[8]))  # 纬度偏差

        data = {'tem': tem, 'pre': pre, 'rh': rh, 'wd': wd, 'ws': ws, 'h': h,
                'time_mis': time_mis, 'lon_de': lon_de, 'lat_de': lat_de, 'time': D_DATETIME}
        return data

    def draw_tlnp(self):
        is_nan = np.isfinite(self.data.PRS_HWC)
        fig, _ = tlnp(self.data.PRS_HWC[is_nan], self.data.TEM[is_nan], self.data.DPT[is_nan],
                      self.data.GPH[is_nan], self.data.WIN_S[is_nan], self.data.WIN_D[is_nan],
                      station_id=int(self.data.Station_Id_C[0]), valid_time=self.data_time)

        pic_path = os.path.join(self.pic_path, self.data_time.strftime('%Y%m'))
        pic_name = f"tlnp_{self.data_time.strftime('%Y%m%d%H')}_t.png"
        if not Path(pic_path).exists():
            Path.mkdir(Path(pic_path), parents=True, exist_ok=True)
        pic_path = os.path.join(pic_path, pic_name)
        fig.savefig(pic_path, dpi=300, bbox_inches="tight", pad_inches=0.05)
        # minio_client.put_object(pic_path)
        pic_info = {"filename": os.path.basename(pic_path), "path": transfer_path(pic_path, is_win_path=True),
                    "element": self.ele}
        return pic_info

    def run(self):
        # data = self.get_pro_data()
        pic_info = []
        if self.ele == 'tlnp':
            pic_info.append(self.draw_tlnp())
            return [{"picFiles": pic_info, "picData": []}]
        data_ele = np.array(self.data[self.ele], dtype=float)
        data_ele[data_ele >= 999] = None
        line_data = [{
            'x': data_ele.tolist(),
            'y': [(np.array(self.data['GPH']) / 1000).tolist()],
            'xlabel': lin_info[self.ele],
            'ylabel': '高度 (km)',
            'yname': [self.title],
            'time': self.data_time.strftime("%Y-%m-%d %H:%M")
        }]
        return [{"picFiles": pic_info, "picData": line_data}]


